ControlPropertyState.AutoRuleBindingString:
If(!IsBlank(ComboBoxUserSearch.Selected.Id),
    Set(_selectedUser, ComboBoxUserSearch.Selected);

    Set(_selectedUserPhoto, 
        If(!IsBlank(_selectedUser.Id) && Office365Users.UserPhotoMetadata(_selectedUser.Id).HasPhoto, 
            Office365Users.UserPhoto(_selectedUser.Id), 
            'profilepic-generic-user'
        )
    );

    Reset(ComboBoxUserSearch);
    Navigate(PersonScreen, None)
)
